import React, { Component } from 'react'

export class List extends Component {
  render() {
    return (
      <div id="container">
        <div id="group1"><select><option>AJAX</option><option>JQuery</option><option>Javascript</option><option>MooTools</option><option>Prototype</option><option>Dojo</option></select></div>
        <div id="group2"></div>
      </div>
    )
  }
}

export default List
